import React from 'react';

function TestApp() {
  console.log('TestApp rendered!');

  return (
    <div style={{
      minHeight: '100vh',
      background: '#f5f1ec',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      flexDirection: 'column',
      gap: '2rem',
      padding: '2rem'
    }}>
      <h1 style={{ color: '#3c4c73', fontSize: '3rem', margin: 0 }}>üóùÔ∏è</h1>
      <h2 style={{ color: '#7e5a75', fontSize: '2rem', margin: 0, textAlign: 'center' }}>
        React is Working!
      </h2>
      <p style={{ color: '#7e5a75', fontSize: '1.2rem', textAlign: 'center', maxWidth: '600px' }}>
        If you can see this message, React is rendering correctly. The issue is likely in the main App component.
      </p>
      <button 
        onClick={() => {
          console.log('Button clicked!');
          alert('JavaScript is working!');
        }}
        style={{
          background: '#7e5a75',
          color: 'white',
          border: 'none',
          borderRadius: '8px',
          padding: '1rem 2rem',
          fontSize: '1.1rem',
          fontWeight: 600,
          cursor: 'pointer'
        }}
      >
        Test Button
      </button>
      <div style={{ 
        background: 'rgba(126,90,117,0.1)', 
        padding: '1rem', 
        borderRadius: '8px',
        fontSize: '0.9rem',
        color: '#7e5a75'
      }}>
        <strong>Debug Info:</strong><br/>
        Timestamp: {new Date().toLocaleString()}<br/>
        Environment: {process.env.NODE_ENV}<br/>
        API URL: {process.env.REACT_APP_API_URL || 'not set'}
      </div>
    </div>
  );
}

export default TestApp;
